import React, { useState } from 'react';
import { useQuery, useMutation, useQueryClient } from 'react-query';
import { useForm } from 'react-hook-form';
import { 
  FileText, 
  Plus, 
  Search, 
  Download, 
  Upload,
  CheckCircle,
  AlertCircle,
  Code,
  User,
  Calendar
} from 'lucide-react';
import toast from 'react-hot-toast';
import { Prism as SyntaxHighlighter } from 'react-syntax-highlighter';
import { tomorrow } from 'react-syntax-highlighter/dist/esm/styles/prism';
import apiService from '../services/api';
import { TRADITIONAL_SYSTEMS, TOAST_MESSAGES } from '../constants';

const ProblemListPage = () => {
  const [activeTab, setActiveTab] = useState('create');
  const [fhirResponse, setFhirResponse] = useState('');
  const [responseType, setResponseType] = useState('');
  const queryClient = useQueryClient();

  const { register, handleSubmit, reset, formState: { errors } } = useForm();

  const createConditionMutation = useMutation(
    (data) => apiService.createCondition(data, 'json'),
    {
      onSuccess: (data) => {
        setFhirResponse(data);
        setResponseType('success');
        toast.success('Dual-coded condition created successfully');
        queryClient.invalidateQueries('stats');
      },
      onError: (error) => {
        setFhirResponse(error.message);
        setResponseType('error');
        toast.error('Condition creation failed');
      },
    }
  );

  const uploadBundleMutation = useMutation(
    (bundle) => apiService.uploadBundle(bundle, 'json'),
    {
      onSuccess: (data) => {
        setFhirResponse(data);
        setResponseType('success');
        toast.success('Bundle processed successfully');
      },
      onError: (error) => {
        setFhirResponse(error.message);
        setResponseType('error');
        toast.error('Bundle processing failed');
      },
    }
  );

  const onSubmitCondition = (data) => {
    createConditionMutation.mutate(data);
  };

  const onSubmitBundle = (data) => {
    try {
      const bundle = JSON.parse(data.bundleJson);
      uploadBundleMutation.mutate(bundle);
    } catch (error) {
      toast.error('Invalid JSON format');
    }
  };

  const copyToClipboard = (text) => {
    navigator.clipboard.writeText(text);
    toast.success('Copied to clipboard');
  };

  const downloadResponse = (data, filename) => {
    const blob = new Blob([data], { type: 'application/json' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = filename;
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
    URL.revokeObjectURL(url);
  };

  const tabs = [
    { id: 'create', name: 'Create Condition', icon: Plus },
    { id: 'bundle', name: 'Upload Bundle', icon: Upload },
    { id: 'autocomplete', name: 'Auto-complete', icon: Search },
    { id: 'examples', name: 'Examples', icon: FileText },
  ];

  const TabButton = ({ tab, isActive, onClick }) => {
    const Icon = tab.icon;
    return (
      <button
        onClick={() => onClick(tab.id)}
        className={`flex items-center px-3 py-2 text-sm font-medium rounded-md ${
          isActive
            ? 'bg-primary-100 text-primary-700'
            : 'text-gray-500 hover:text-gray-700 hover:bg-gray-50'
        }`}
      >
        <Icon className="mr-2 h-4 w-4" />
        {tab.name}
      </button>
    );
  };

  const ResponseViewer = ({ data, title }) => (
    <div className="bg-white shadow rounded-lg">
      <div className="px-4 py-5 sm:p-6">
        <div className="flex items-center justify-between mb-4">
          <h3 className="text-lg font-medium text-gray-900">{title}</h3>
          <div className="flex items-center space-x-2">
            {data && (
              <>
                <button
                  onClick={() => copyToClipboard(data)}
                  className="btn-secondary text-sm"
                >
                  Copy
                </button>
                <button
                  onClick={() => downloadResponse(data, `${title.toLowerCase()}.json`)}
                  className="btn-secondary text-sm"
                >
                  <Download className="h-4 w-4 mr-1" />
                  Download
                </button>
              </>
            )}
          </div>
        </div>

        {data ? (
          <div className="bg-gray-900 rounded-lg p-4 overflow-auto">
            <SyntaxHighlighter
              language="json"
              style={tomorrow}
              customStyle={{ margin: 0, fontSize: '14px' }}
            >
              {data}
            </SyntaxHighlighter>
          </div>
        ) : (
          <div className="text-center py-12">
            <FileText className="mx-auto h-12 w-12 text-gray-400" />
            <h3 className="mt-2 text-sm font-medium text-gray-900">No response yet</h3>
            <p className="mt-1 text-sm text-gray-500">
              Create a condition or upload a bundle to see the FHIR response.
            </p>
          </div>
        )}
      </div>
    </div>
  );

  return (
    <div className="space-y-6">
      {/* Header */}
      <div>
        <h1 className="text-2xl font-bold text-gray-900">Problem List - Dual Coding</h1>
        <p className="mt-1 text-sm text-gray-500">
          FHIR-compliant dual coding for NAMASTE and ICD-11 integration
        </p>
      </div>

      {/* Tabs */}
      <div className="bg-white shadow rounded-lg">
        <div className="px-4 py-5 sm:p-6">
          <div className="flex flex-wrap gap-2">
            {tabs.map((tab) => (
              <TabButton
                key={tab.id}
                tab={tab}
                isActive={activeTab === tab.id}
                onClick={setActiveTab}
              />
            ))}
          </div>
        </div>
      </div>

      {/* Create Condition Tab */}
      {activeTab === 'create' && (
        <div className="space-y-6">
          <div className="bg-white shadow rounded-lg">
            <div className="px-4 py-5 sm:p-6">
              <h3 className="text-lg font-medium text-gray-900 mb-4">Create Dual-Coded Condition</h3>
              <form onSubmit={handleSubmit(onSubmitCondition)} className="space-y-4">
                <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
                  <div>
                    <label className="block text-sm font-medium text-gray-700 mb-2">
                      NAMASTE Code *
                    </label>
                    <input
                      {...register('namasteCode', { required: 'NAMASTE code is required' })}
                      className="input"
                      placeholder="e.g., NAM001"
                    />
                    {errors.namasteCode && (
                      <p className="mt-1 text-sm text-red-600">{errors.namasteCode.message}</p>
                    )}
                  </div>
                  <div>
                    <label className="block text-sm font-medium text-gray-700 mb-2">
                      Patient ID *
                    </label>
                    <input
                      {...register('patientId', { required: 'Patient ID is required' })}
                      className="input"
                      placeholder="e.g., Patient/123"
                    />
                    {errors.patientId && (
                      <p className="mt-1 text-sm text-red-600">{errors.patientId.message}</p>
                    )}
                  </div>
                  <div>
                    <label className="block text-sm font-medium text-gray-700 mb-2">
                      Encounter ID (Optional)
                    </label>
                    <input
                      {...register('encounterId')}
                      className="input"
                      placeholder="e.g., Encounter/456"
                    />
                  </div>
                </div>
                <div className="flex justify-end">
                  <button
                    type="submit"
                    disabled={createConditionMutation.isLoading}
                    className="btn-primary"
                  >
                    {createConditionMutation.isLoading ? 'Creating...' : 'Create Condition'}
                  </button>
                </div>
              </form>
            </div>
          </div>

          {fhirResponse && (
            <ResponseViewer 
              data={fhirResponse} 
              title={`Dual-Coded Condition ${responseType === 'success' ? '(Success)' : '(Error)'}`}
            />
          )}
        </div>
      )}

      {/* Upload Bundle Tab */}
      {activeTab === 'bundle' && (
        <div className="space-y-6">
          <div className="bg-white shadow rounded-lg">
            <div className="px-4 py-5 sm:p-6">
              <h3 className="text-lg font-medium text-gray-900 mb-4">Upload Dual-Coded Bundle</h3>
              <form onSubmit={handleSubmit(onSubmitBundle)} className="space-y-4">
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    FHIR Bundle JSON *
                  </label>
                  <textarea
                    {...register('bundleJson', { required: 'Bundle JSON is required' })}
                    rows={15}
                    className="input font-mono text-sm"
                    placeholder='{"resourceType": "Bundle", "type": "collection", "entry": [...]}'
                  />
                  {errors.bundleJson && (
                    <p className="mt-1 text-sm text-red-600">{errors.bundleJson.message}</p>
                  )}
                </div>
                <div className="flex justify-end">
                  <button
                    type="submit"
                    disabled={uploadBundleMutation.isLoading}
                    className="btn-primary"
                  >
                    {uploadBundleMutation.isLoading ? 'Processing...' : 'Upload Bundle'}
                  </button>
                </div>
              </form>
            </div>
          </div>

          {fhirResponse && (
            <ResponseViewer 
              data={fhirResponse} 
              title={`Bundle Processing Result ${responseType === 'success' ? '(Success)' : '(Error)'}`}
            />
          )}
        </div>
      )}

      {/* Auto-complete Tab */}
      {activeTab === 'autocomplete' && (
        <div className="space-y-6">
          <div className="bg-white shadow rounded-lg">
            <div className="px-4 py-5 sm:p-6">
              <h3 className="text-lg font-medium text-gray-900 mb-4">Auto-complete Suggestions</h3>
              <div className="space-y-4">
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Search Term
                  </label>
                  <input
                    type="text"
                    className="input"
                    placeholder="Enter search term..."
                  />
                </div>
                <div className="flex justify-end">
                  <button className="btn-primary">
                    <Search className="h-4 w-4 mr-2" />
                    Get Suggestions
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>
      )}

      {/* Examples Tab */}
      {activeTab === 'examples' && (
        <div className="space-y-6">
          <div className="bg-white shadow rounded-lg">
            <div className="px-4 py-5 sm:p-6">
              <h3 className="text-lg font-medium text-gray-900 mb-4">FHIR Examples</h3>
              
              <div className="space-y-6">
                <div>
                  <h4 className="text-md font-medium text-gray-800 mb-2">Dual-Coded Condition Example</h4>
                  <div className="bg-gray-900 rounded-lg p-4 overflow-auto">
                    <SyntaxHighlighter
                      language="json"
                      style={tomorrow}
                      customStyle={{ margin: 0, fontSize: '12px' }}
                    >
                      {`{
  "resourceType": "Condition",
  "id": "condition-123",
  "clinicalStatus": {
    "coding": [{
      "system": "http://terminology.hl7.org/CodeSystem/condition-clinical",
      "code": "active",
      "display": "Active"
    }]
  },
  "code": {
    "coding": [
      {
        "system": "http://terminology.ayush.gov.in/CodeSystem/namaste",
        "code": "NAM001",
        "display": "Vata Dosha Imbalance",
        "version": "1.0"
      },
      {
        "system": "http://id.who.int/icd/release/11/2019-04",
        "code": "TM2-001",
        "display": "ICD-11 TM2: Traditional Medicine Pattern",
        "version": "2019-04"
      }
    ]
  },
  "subject": {
    "reference": "Patient/123"
  }
}`}
                    </SyntaxHighlighter>
                  </div>
                </div>

                <div>
                  <h4 className="text-md font-medium text-gray-800 mb-2">Bundle Upload Example</h4>
                  <div className="bg-gray-900 rounded-lg p-4 overflow-auto">
                    <SyntaxHighlighter
                      language="json"
                      style={tomorrow}
                      customStyle={{ margin: 0, fontSize: '12px' }}
                    >
                      {`{
  "resourceType": "Bundle",
  "type": "collection",
  "entry": [
    {
      "resource": {
        "resourceType": "Condition",
        "code": {
          "coding": [
            {
              "system": "http://terminology.ayush.gov.in/CodeSystem/namaste",
              "code": "NAM001",
              "display": "Vata Dosha Imbalance"
            }
          ]
        },
        "subject": {
          "reference": "Patient/123"
        }
      }
    }
  ]
}`}
                    </SyntaxHighlighter>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export { ProblemListPage };
